      const TiebaPCApi = {
        async getUserAllLinkForum() {
          let result = [];
          let gbkEncoder = new utils.GBKEncoder();
          let page = 1;
          while (true) {
            let searchParamsData = {
              v: Date.now(),
              pn: page,
            };
            let url = `https://tieba.baidu.com/f/like/mylike?${utils.toSearchParamsStr(searchParamsData)}`;
            let getResponse = await httpx.get(url, {
              fetch: true,
            });
            if (!getResponse.status) {
              break;
            }
            let doc = domUtils.toElement(getResponse.data.responseText, true, true);
            let linkForumInfoList = Array.from(doc.querySelectorAll(".forum_table span[balvname]"))
              .map((item) => {
                let forumName = item.getAttribute("balvname");
                let forumId = item.getAttribute("balvid");
                let tbs2 = item.getAttribute("tbs");
                if (forumName == null) {
                  return;
                }
                if (forumId == null) {
                  return;
                }
                if (tbs2 == null) {
                  return;
                }
                forumName = gbkEncoder.decode(forumName);
                return {
                  forumName,
                  forumId,
                  tbs: tbs2,
                };
              })
              .filter((item) => item != null);
            result = result.concat(linkForumInfoList);
            let $nextPage = Array.from(doc.querySelectorAll("#j_pagebar .pagination a[href]")).find(($anchor) => {
              return $anchor.innerText.includes("‰∏ã‰∏ÄÈ°µ");
            });
            if ($nextPage == null) {
              break;
            } else {
              let nextPageUrl = CommonUtil.fixUrl($nextPage.href);
              let nextPageUrlObj = new URL(nextPageUrl);
              let nextPagePn = new URLSearchParams(nextPageUrlObj.search);
              if (nextPagePn.has("pn")) {
                page = parseInt(nextPagePn.get("pn"));
              } else {
                break;
              }
            }
            await utils.sleep(500);
          }
          return result;
        },
      };
